import React from 'react';
import styled from 'styled-components';
const Card = ({ children }) => {
  const UnderLine = styled.div`
    text-decoration: underline;
    font-size: 0.5rem;
  `;
  const Background = styled.div`
    background-color: white;
    width: 15rem;
    margin-bottom: 20px;
    padding: 10px;
  `;
  return (
    <>
      <Background>{children}</Background>
    </>
  );
};

export default Card;
